import React from "react";
import InputField from "./InputField";

const ShapeDimensionForm = ({ values, handleChange }) => {
  console.log(values);

  switch (values.shape) {
    case "circle":
      let events = {
        event: onclick,
        func: handleChange
      };
      return (
        <div>
          Please specify diameter
          <InputField
            type="text"
            name="diameter"
            classes="form-input-field"
            event={events}
          />
        </div>
      );
  }

  //return <h4>Shape Dimensions here</h4>;
};

export default ShapeDimensionForm;
